result:
query {
  videoSeries:allContentfulVideoSeries (filter: { category: { contains: "Community" } }, sortBy: "title", order: ASC) {
    edges {
      node {
      	id
        slug
        title
        content
        summary
        posts (limit: 4, order: ASC) {
            id
            slug
            thumbnail {
              file {
                url
              }
            }
            youtubeId
            title
            content
            summary
            territory
    	  }
      }
  	}
  }
}
